// 1047. 删除字符串中的所有相邻重复项

// 给出由小写字母组成的字符串 S，重复项删除操作会选择两个相邻且相同的字母，并删除它们。

// 在 S 上反复执行重复项删除操作，直到无法继续删除。

// 在完成所有重复项删除操作后返回最终的字符串。答案保证唯一。

// 示例：

// 输入："abbaca"
// 输出："ca"

// 递归
// O(n²) 内存溢出了
// const removeDuplicates = s => {
//   const len = s.length;
//   if (len < 2) return s;
//   for (let i = 1; i < len; i++) {
//     if (s[i] === s[i - 1]) return removeDuplicates(`${s.slice(0, i - 1)}${s.slice(i + 1)}`);
//   }
//   return s;
// };

// 执行用时：
// O(n) O(n)
// 76 ms, 在所有 JavaScript 提交中击败了 77.36% 的用户
// 内存消耗：
// 48.94 MB, 在所有 JavaScript 提交中击败了 77.28% 的用户
const removeDuplicates = s => {
  const len = s.length;
  const arr = [];
  for (let i = 0; i < len; i++) {
    if (s[i] === arr[arr.length - 1]) {
      arr.pop();
    } else {
      arr.push(s[i]);
    }
  }
  return arr.join('');
};

const s = '';

console.log(removeDuplicates(s));
